import './App.css';
import { useState } from 'react';
import Profile from './profile';
import Pagination from './slide';
import Loader from './loader';

function App() {
  const [state,setstate]=useState(1);
  return (
    <div className="mainapp">
      <Profile state={state}/>
      <Pagination setstate={setstate} state={state}/>
      </div>
  );
}

export default App;
